hildren";s:0:"";}i:7;a:31:{s:2:"id";i:9;s:11:"channeltype";i:1;s:15:"current_channel";i:6;s:9:"parent_id";i:1;s:8:"typename";s:12:"企业文化";s:7:"dirname";s:10:"qiyewenhua";s:7:"dirpath";s:23:"/guanyuwomen/qiyewenhua";s:12:"englist_name";s:0:"";s:5:"grade";i:1;s:8:"typelink";s:0:"";s:6:"litpic";s:61:"/uploads/allimg/20190307/41d49088a1ddd48195f48e94ad7c2d15.jpg";s:8:"templist";s:16:"lists_single.htm";s:8:"tempview";s:0:"";s:9:"seo_title";s:0:"";s:12:"seo_keywords";s:0:"";s:15:"seo_description";s:1020:"核心价值观：诚信、创新、服务，企业核心： 诚信，企业精神： 团结拼搏、开拓求实、满足用户、科技进步。客户：为客户提供高质量和最大价值的专业化产品和服务，以真诚和实力赢得客户的理解、尊重和支持。市场：为客户降低采购成本和风险，为客户投资提供切实保障。发展：追求永续发展的目标，并把它建立在客户满意的基础上。关于“为合作伙伴创造价值”公司认为客户、供应商、公司股东、公司员工等一切和自身有合作关系的单位和个人都是自己的合作伙伴，并只有通过努力为合作伙伴创造价值，才能体现自身的价值并获得发展和成功。关于“诚实、宽容、创新、服务”公司认为诚信是一切合作的基础，宽容是解决问题的前提，创新是发展事业的利器，服务是创造价值的根本。公司会坚持持续改进、满足顾客期望、 确保品质第一、开拓全球市场。";s:10:"sort_order";i:100;s:9:"is_hidden";i:0;s:7:"is_part";i:0;s:8:"admin_id";i:1;s:6:"is_del";i:0;s:10:"del_method";i:0;s:6:"status";i:1;s:10:"is_release";i:0;s:10:"weapp_code";s:0:"";s:4:"lang";s:2:"cn";s:8:"add_time";i:1551921859;s:11:"update_time";i:1570976417;s:6:"typeid";i:9;s:12:"has_children";i:0;s:8:"children";s:0:"";}i:8;a:31:{s:2:"id";i:12;s:11:"channeltype";i:1;s:15:"current_channel";i:6;s:9:"parent_id";i:1;s:8:"typename";s:12:"公司团队";s:7:"dirname";s:13:"gongsituandui";s:7:"dirpath";s:26:"/guanyuwomen/gongsituandui";s:12:"englist_name";s:0:"";s:5:"grade";i:1;s:8:"typelink";s:0:"";s:6:"litpic";s:0:"";s:8:"templist";s:16:"lists_single.htm";s:8:"tempview";s:0:"";s:9:"seo_title";s:0:"";s:12:"seo_keywords";s:0:"";s:15:"seo_description";s:1046:"研发管理就是在研发体系结构设计和各种管理理论基础之上，借助信息平台对研发过程中进行的团队建设、流程设计、绩效管理、风险管理、成本管理、项目管理和知识管理等的一系列协调活动。研发管理，是一个较为宽泛的管理范畴。可以从狭义和广义两个方面来进行理解：狭义的定义：是指对研发或技术部门及其工作进行管理，重点是产品开发及测试过程。广义的定义：研发工作实际上不仅仅包含技术开发工作，其范围涵盖新产品的全生命周期，以从产品创意的产生、产品概念形成、产品市场研究、产品设计、产品实现、产品开发、产品中试、产品发布等整个过程。从管理的角度来看，其范围涵盖产品战略与规划、市场分析与产品规划、产品及研发组织结构设计、研发项目管理、研发质量管理、研发团队管理、研发绩效管理、研发人力资源管理、平台开发与技术预研等领域。
